import { useState, useLayoutEffect } from "react";
function Content() {
    const [count, setCount] = useState();
    const handleCount = () => {
        setCount(count + 1);
    }
    return (
        <>
            <p>{count}</p>
            <button onClick={handleCount}>Click</button>
        </>
    )
}

export default Content;
